import{_ as a,c as o,a3 as t,o as l}from"./chunks/framework.CAwIQbWu.js";const d=JSON.parse('{"title":"注销登记篇","description":"","frontmatter":{},"headers":[],"relativePath":"SubjectOne/常识/注销登记篇.md","filePath":"SubjectOne/常识/注销登记篇.md","lastUpdated":1736413709000}'),r={name:"SubjectOne/常识/注销登记篇.md"};function c(n,e,u,i,s,h){return l(),o("div",null,e[0]||(e[0]=[t('<h1 id="注销登记篇" tabindex="-1">注销登记篇 <a class="header-anchor" href="#注销登记篇" aria-label="Permalink to &quot;注销登记篇&quot;">​</a></h1><h2 id="_1-达到报废标准" tabindex="-1">1. 达到报废标准 <a class="header-anchor" href="#_1-达到报废标准" aria-label="Permalink to &quot;1. 达到报废标准&quot;">​</a></h2><blockquote><p>机动车已达到国家强制报废标准的，机动车所有人应申请办理<strong>注销登记</strong>，申请注销登记时应将机动车<strong>交售给回收企业</strong>。</p></blockquote><blockquote><p>办理机动车变更登记、转让登记或者注销登记后，原机动车所有人重新申请机动车登记时，若想使用原机动车号牌号码，应先处理完原机动车的交通违法记录。</p></blockquote><h2 id="_2-因质量问题退车" tabindex="-1">2. 因质量问题退车 <a class="header-anchor" href="#_2-因质量问题退车" aria-label="Permalink to &quot;2. 因质量问题退车&quot;">​</a></h2><blockquote><p>因质量问题退车的，机动车所有人应当向登记地车辆管理所申请注销登记。</p></blockquote><h2 id="_3-自愿报废" tabindex="-1">3. 自愿报废 <a class="header-anchor" href="#_3-自愿报废" aria-label="Permalink to &quot;3. 自愿报废&quot;">​</a></h2><blockquote><p>机动车未达到国家强制报废标准，机动车所有人自愿报废的，应向登记地车管所申请注销登记。</p></blockquote><h2 id="_4-被依法撤销" tabindex="-1">4. 被依法撤销 <a class="header-anchor" href="#_4-被依法撤销" aria-label="Permalink to &quot;4. 被依法撤销&quot;">​</a></h2><blockquote><p>机动车被盗抢骗的，不予办理注册登记（被盗抢骗的是受害者），已注册登记的机动车被依法撤销的会被车管所注销。</p></blockquote><blockquote><p>机动车属于被盗抢骗的，予以办理注册登记。</p></blockquote><h2 id="_5-逾期一年注销-驾驶证" tabindex="-1">5. 逾期一年注销（驾驶证） <a class="header-anchor" href="#_5-逾期一年注销-驾驶证" aria-label="Permalink to &quot;5. 逾期一年注销（驾驶证）&quot;">​</a></h2><blockquote><p>超过机动车驾驶证有效期1年以上未换证的，车管所应注销其驾驶证。</p></blockquote><ul><li>未换证被注销，但未超过2年的，补考科一</li></ul><blockquote><p>被注销未超2年的，通过道路交通安全法律、法规和相关知识考试后，可恢复驾驶资格。</p></blockquote>',15)]))}const p=a(r,[["render",c]]);export{d as __pageData,p as default};
